function calculateScaledStats(baseStats, minutes) {
    const level = Math.floor(minutes / 3);
    return {
        hp: Math.min(baseStats.maxHP || Infinity, baseStats.baseHP + (baseStats.hpPerLevel * level)),
        power: baseStats.basePower + (baseStats.powerPerLevel || 0) * level,
        Protections: Math.min(baseStats.maxProtections || Infinity, 
            baseStats.baseProtections + (baseStats.protectionsPerLevel * level)),
        // Fix these property names to match your data object
        goldreward: baseStats.goldreward + (baseStats.goldrewardperlevel * level),
        expreward: baseStats.expreward + (baseStats.exprewardperlevel * level)
    };

}
function formatTooltipStats(content) {
    return content
        // Remove "Base" before stats
        .replace(/Base (HP|Power):/g, '$1:')
        //  main stats
        .replace(
            /(HP):/g, 
            '<span style="color: #33c954;">$1</span>:'
        ).replace(
            /(Protections):/g, 
            '<span style="color: #8a98a8;">$1</span>:'
        ).replace(
            /(Gold)([ ]?Reward)?/g, 
            '<span style="color: #ffd700;">$1$2</span>'
        ).replace(
            /(Exp)([ ]?Reward)?/g, 
            '<span style="color: #4d9fff;">$1$2</span>'
        ).replace(
            /(Power):/g, 
            '<span style="color: #ff4d4d;">$1</span>:'
        )
        //End of main stats//

        // buff-related terms
        .replace(
            /(Strength)/g, 
            '<span style="color: #ff6347;">$1</span>'  // Red-orange
        ).replace(
            /(Intelligence)/g, 
            '<span style="color: #9370db;">$1</span>'  // Purple
        ).replace(
            /(Mana Regeneration)/g, 
            '<span style="color: #1e90ff;">$1</span>'  // Blue
        ).replace(
            /(movement speed)/gi, 
            '<span style="color: #ffd700;">$1</span>'  // Yellow
        ).replace(
            /(health)/gi, 
            '<span style="color: #33c954;">$1</span>'  // Green
        ).replace(
            /(mana)/gi, 
            '<span style="color: #1e90ff;">$1</span>'  // Blue
        ).replace(
            /(poison)/gi, 
            '<span style="color: #ac51cc;">$1</span>'  // purple
        ).replace(
            /\\b(teleport|teleporting)\\b/gi,            // purple
            '<span style="color: #800080;">$1</span>'
);

        
}


